import Counter from './components/Counter';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="headerDiv">
          <nav className="caoimhesNavBar">
            <nav brand>Caoimhe Ruddy</nav>
            <nav href="https://github.com/caoimheruddy/caoimhes-react-counter">Home</nav>
            <nav href="#about">About</nav>
            <nav href="#contact">Contact</nav>
          </nav>
        </div>
      </header>

    </div>
  );
}

export default App;
